  null,\n\t\"notes\": \"Ionograms are recorded tracings of reflected high frequency
  radio pulses generated by an ionosonde. Unique relationships exist between the sounding
  frequency and the ionization densities which can reflect it. As the sounder sweeps
  from lower to higher frequencies, the signal rises above the noise of commercial
  radio sources and records the return signal reflected from the different layers
  of the ionosphere.\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
